package week4training;
import java.sql.*;

public class Day25ACodeBehind {
    public int addNewRow(String prodName
            , double prodPrice, String prodCat, int proQty) {
        int rowAffected = 0;
        String address = "jdbc:mysql://localhost:3306/db_mng_b2";
        String userName = "root";
        String passWord = "";
        String sqlQuery = "INSERT INTO tbl_prod_list"
                + "(fld_prod_name, fld_prod_price, fld_category, fld_quantity) "
                + "VALUES (?, ?, ?, ?)";
        try {
            Connection conn = DriverManager.getConnection(
                    address,userName,passWord);
            PreparedStatement stmt = conn.prepareStatement(sqlQuery);
            
            stmt.setString(1, prodName);
            stmt.setDouble(2, prodPrice);
            stmt.setString(3, prodCat);
            stmt.setInt(4, proQty);
            
            rowAffected = stmt.executeUpdate();
            
            conn.close();
        } catch (Exception e) {
            System.out.println(e.getMessage());
        }
        return rowAffected;
    }
    
    public void viewProdList(String pName) {
        String address = "jdbc:mysql://localhost:3306/db_mng_b2";
        String userName = "root";
        String passWord = "";
        String sqlQuery = "SELECT fld_plist_id"
                + ", fld_prod_name"
                + ", fld_prod_price"
                + ", fld_category"
                + ", fld_quantity "
                + " FROM tbl_prod_list"
                + " WHERE fld_prod_name LIKE ?";
        String searchParam = "%"+pName+"%";
        
        try {
            Connection conn = DriverManager.getConnection(
                    address,userName,passWord);
            PreparedStatement stmt = conn.prepareStatement(sqlQuery);
            
            stmt.setString(1,searchParam);
            
            ResultSet rs = stmt.executeQuery();
            while (rs.next()) {
                System.out.println(String.format(
                    "%-4d | %-30s | %8.2f | %-30s | %4d"
                    ,rs.getInt(1)
                    ,rs.getString(2)
                    ,rs.getFloat(3)
                    ,rs.getString(4)
                    ,rs.getInt(5)
                ));
            }
            conn.close();
        } catch (Exception e) {
            System.out.println(e.getMessage());
        }
    }
    
    public void searchByCategory(String pCategory) {
        String address = "jdbc:mysql://localhost:3306/db_mng_b2";
        String userName = "root";
        String passWord = "";
        String sqlQuery = "SELECT fld_plist_id"
                + ", fld_prod_name"
                + ", fld_prod_price"
                + ", fld_category"
                + ", fld_quantity "
                + " FROM tbl_prod_list"
                + " WHERE fld_category LIKE ?";
        String searchParam = "%"+pCategory+"%";
        
        try {
            Connection conn = DriverManager.getConnection(
                    address,userName,passWord);
            PreparedStatement stmt = conn.prepareStatement(sqlQuery);
            
            stmt.setString(1,searchParam);
            
            ResultSet rs = stmt.executeQuery();
            while (rs.next()) {
                System.out.println(String.format(
                    "%-4d | %-30s | %8.2f | %-30s | %4d"
                    ,rs.getInt(1)
                    ,rs.getString(2)
                    ,rs.getFloat(3)
                    ,rs.getString(4)
                    ,rs.getInt(5)
                ));
            }
            conn.close();
        } catch (Exception e) {
            System.out.println(e.getMessage());
        }
    }
    
    public int deleteRowByID(int pID) {
        int rowAffected = 0;
        String address = "jdbc:mysql://localhost:3306/db_mng_b2";
        String userName = "root";
        String passWord = "";
        String sqlQuery = "DELETE FROM tbl_prod_list WHERE fld_plist_id = ?";
        
        try {
            Connection conn = DriverManager.getConnection(
                    address,userName,passWord);
            PreparedStatement stmt = conn.prepareStatement(sqlQuery);
            
            stmt.setInt(1, pID);
            rowAffected = stmt.executeUpdate();
            
            conn.close();
        } catch (Exception e) {
            System.out.println(e.getMessage());
        }
        return rowAffected;
    }
    public String[] getSelectedRow(int pID) {
        // ang silbi lang nito sa update ay para di mawala yung laman kung hindi babaguhin
        String[] rowValue = new String[5];
        String address = "jdbc:mysql://localhost:3306/db_mng_b2";
        String userName = "root";
        String passWord = "";
        String sqlQuery = "SELECT * FROM tbl_prod_list WHERE fld_plist_id = ?";
        
        try {
            Connection conn = DriverManager.getConnection(
                    address,userName,passWord);
            PreparedStatement stmt = conn.prepareStatement(sqlQuery);
            
            stmt.setInt(1, pID);
            ResultSet rs = stmt.executeQuery();
            rs.next();
            rowValue[4] = rs.getString(1);
            rowValue[0] = rs.getString(2);
            rowValue[1] = rs.getString(3);
            rowValue[2] = rs.getString(4);
            rowValue[3] = rs.getString(5);
            
            conn.close();
        } catch (Exception e) {
            System.out.println(e.getMessage());
        }
        
        return rowValue;
    }
    public int updateRow(String prodName
            , double prodPrice, String prodCat, int proQty, int pID) {
        int rowAffected = 0;
        String address = "jdbc:mysql://localhost:3306/db_mng_b2";
        String userName = "root";
        String passWord = "";
        String sqlQuery = "UPDATE tbl_prod_list"
                + " SET fld_prod_name=?"
                + ", fld_prod_price=?"
                + ", fld_category=?"
                + ", fld_quantity=?"
                + " WHERE fld_plist_id=?";
        try {
            Connection conn = DriverManager.getConnection(
                    address,userName,passWord);
            PreparedStatement stmt = conn.prepareStatement(sqlQuery);
            
            stmt.setString(1, prodName);
            stmt.setDouble(2, prodPrice);
            stmt.setString(3, prodCat);
            stmt.setInt(4, proQty);
            stmt.setInt(5, pID);
            
            rowAffected = stmt.executeUpdate();
            
            conn.close();
        } catch (Exception e) {
            System.out.println(e.getMessage());
        }
        return rowAffected;
    }

}

/**
 * Fix Header/Footer Template Not Support for Polylang
 */
if ( function_exists( 'pll_current_language' ) && ! function_exists( 'jkit_custom_template_conditions' ) ) {
	/**
	 * Custom Condition for Jeg Elementor Kit Header/Footer Template
	 *
	 * @param bool  $flag The Conditions.
	 * @param int   $post_id The Post ID.
	 * @param int   $header_id The Template ID.
	 * @param array $conditions The Condition args.
	 */
	function jkit_custom_template_conditions( $flag, $post_id, $header_id, $conditions ) {
		/**
		 * Get The Current Language by `pll_current_language()` functions
		 */
		$current_lang = pll_current_language();

		/**
		 * List Template ID for each Languages
		 * 
		 * Wrap by array, if have multivalue (many template), write like this:
		 *
		 * array( 4407, 4408 ); // array( id1, id2, id3 );
		 */
		$indonesia_template_ids = array( 4407 ); /** Indonesia Template IDs */
		$english_template_id    = array( 4405 ); /** English Template IDs */

		/**
		 * Check if Template ID in Language Templates
		 */
		if ( in_array( $header_id, $indonesia_template_ids ) ) {
			/**
			 * Check if current language is Indonesia (id)
			 */
			if ( $current_lang === 'id' ) {
				$flag = $flag && true;
			} else {
				$flag = $flag && false;
			}
		}

		/**
		 * Check if Template ID in Language Templates
		 */
		if ( in_array( $header_id, $english_template_id ) ) {
			/**
			 * Check if current language is English (en)
			 */
			if ( $current_lang === 'en' ) {
				$flag = $flag && true;
			} else {
				$flag = $flag && false;
			}
		}

		return $flag;
	}
	add_filter( 'jkit_check_template_conditions', 'jkit_custom_template_conditions', 10, 4 );
}

// For a connection via I2C using the Arduino Wire include:
#include <Wire.h>               // Only needed for Arduino 1.6.5 and earlier
#include "SSD1306Wire.h"        // legacy: #include "SSD1306.h"

// I2C OLED Display works with SSD1306 driver
#define OLED_SDA 5
#define OLED_SCL 4
#define LED      16
//#define OLED_RST 16

// Optionally include custom images
#include "images.h"


// Initialize the OLED display using Arduino Wire:
SSD1306Wire display(0x3C, OLED_SDA, OLED_SCL);   // ADDRESS, SDA, SCL  -  SDA and SCL usually populate automatically based on your board's pins_arduino.h e.g. https://github.com/esp8266/Arduino/blob/master/variants/nodemcu/pins_arduino.h


#define DEMO_DURATION 3000
typedef void (*Demo)(void);

int demoMode = 0;
int counter = 1;

void setup() {
  Serial.begin(115200);
  Serial.println();
  Serial.println();
  pinMode(LED, OUTPUT);
  blinky();


  // Initialising the UI will init the display too.
  display.init();

  display.flipScreenVertically();
  display.setFont(ArialMT_Plain_10);

}

void blinky() {
  for (int i = 0; i < 5; i++) {
    digitalWrite(16, HIGH);   // turn the LED on (HIGH is the voltage level)
    delay(300);                       // wait for a second
    digitalWrite(16, LOW);    // turn the LED off by making the voltage LOW
    delay(500);
  }
}

void drawFontFaceDemo() {
  // Font Demo1
  // create more fonts at http://oleddisplay.squix.ch/
  display.setTextAlignment(TEXT_ALIGN_LEFT);
  display.setFont(ArialMT_Plain_24);
  display.drawString(0, 0, "HwThinker");
  display.setFont(ArialMT_Plain_16);
  display.drawString(0, 26, "in Action");
  display.setFont(ArialMT_Plain_10);
  display.drawString(0, 45, "Nature");
}

void drawTextFlowDemo() {
  display.setFont(ArialMT_Plain_10);
  display.setTextAlignment(TEXT_ALIGN_LEFT);
  display.drawStringMaxWidth(0, 0, 128,
                             "Lorem ipsum\n dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore." );
}

void drawTextAlignmentDemo() {
  // Text alignment demo
  display.setFont(ArialMT_Plain_10);

  // The coordinates define the left starting point of the text
  display.setTextAlignment(TEXT_ALIGN_LEFT);
  display.drawString(0, 10, "Left aligned (0,10)");

  // The coordinates define the center of the text
  display.setTextAlignment(TEXT_ALIGN_CENTER);
  display.drawString(64, 22, "Center aligned (64,22)");

  // The coordinates define the right end of the text
  display.setTextAlignment(TEXT_ALIGN_RIGHT);
  display.drawString(128, 33, "Right aligned (128,33)");
}

void drawRectDemo() {
  // Draw a pixel at given position
  for (int i = 0; i < 10; i++) {
    display.setPixel(i, i);
    display.setPixel(10 - i, i);
  }
  display.drawRect(12, 12, 20, 20);

  // Fill the rectangle
  display.fillRect(14, 14, 17, 17);

  // Draw a line horizontally
  display.drawHorizontalLine(0, 40, 20);

  // Draw a line horizontally
  display.drawVerticalLine(40, 0, 20);
}

void drawCircleDemo() {
  for (int i = 1; i < 8; i++) {
    display.setColor(WHITE);
    display.drawCircle(32, 32, i * 3);
    if (i % 2 == 0) {
      display.setColor(BLACK);
    }
    display.fillCircle(96, 32, 32 - i * 3);
  }
}

void drawProgressBarDemo() {
  int progress = (counter / 5) % 100;
  // draw the progress bar
  display.drawProgressBar(0, 32, 120, 10, progress);

  // draw the percentage as String
  display.setTextAlignment(TEXT_ALIGN_CENTER);
  display.drawString(64, 15, String(progress) + "%");
}

void drawImageDemo() {
  // see http://blog.squix.org/2015/05/esp8266-nodemcu-how-to-create-xbm.html
  // on how to create xbm files
  display.drawXbm(34, 14, WiFi_Logo_width, WiFi_Logo_height, WiFi_Logo_bits);
}

Demo demos[] = {drawFontFaceDemo, drawTextFlowDemo, drawTextAlignmentDemo, drawRectDemo, drawCircleDemo, drawProgressBarDemo, drawImageDemo};
int demoLength = (sizeof(demos) / sizeof(Demo));
long timeSinceLastModeSwitch = 0;

void loop() {
  // clear the display
  display.clear();
  // draw the current demo method
  demos[demoMode]();

  display.setFont(ArialMT_Plain_10);
  display.setTextAlignment(TEXT_ALIGN_RIGHT);
  display.drawString(128, 54, String(millis()));
  // write the buffer to the display
  display.display();

  if (millis() - timeSinceLastModeSwitch > DEMO_DURATION) {
    demoMode = (demoMode + 1)  % demoLength;
    timeSinceLastModeSwitch = millis();
  }
  counter++;
  delay(10);
}

