using System;
using System.Collections.Generic;
using System.Linq;
 
namespace Game
{
    class Program
    {
        static void Main(string[] args)
        {
 
            string n = Console.ReadLine();
 
            List<int> number = n.ToString()
                .Select(x => Convert.ToInt32(x.ToString()))
                .ToList();
 
            int case1 = number[0] + number[1] + number[2];
 
            int case2 = number[0] * number[1] + number[2];
 
            int case3 = number[0] + number[1] * number[2];
 
            int case4 = number[0]*number[1]*number[2];
 
            //int case5 = number[0] * number[1] * number[2];
 
            
 
            int result = Math.Max(case1,(Math.Max(case2,(Math.Max(case3,case4)))));
 
            Console.WriteLine(result);
 
        }
    }
}

package dds_challenges;

import java.util.ArrayList;
import java.util.Arrays;
import java.util.List;

public class TestPalindromePartitioning2 {

	public static class PalindromePartitioningAlgorithm {

		private final String input;
		private final char[] inputChars;
		private final int inputLength;
		private final List<String[]> palindromePartitions;

		private final boolean[][] isPalindromeSubstring;
		private final String[][] palindromeSubstrings;

		public PalindromePartitioningAlgorithm(String input) {
			this.input = input;
			this.inputChars = input.toCharArray();
			inputLength = inputChars.length;
			palindromePartitions = new ArrayList<>(0b1 << (inputLength - 1));
			isPalindromeSubstring = new boolean[inputLength][inputLength];
			palindromeSubstrings = new String[inputLength][inputLength];
		}

		public List<String[]> computeResult() {
			precomputePalindromeSubstrings();
			partition(new String[inputLength], 0, 0);
			return palindromePartitions;
		}

		private void precomputePalindromeSubstrings() {
			// this is O(n³), but checking for palindromes while partitioning would be O(2^n * n), so this is still preferable.
			for (int length = 1; length <= inputLength; length++) {
				int maxPosition = inputLength - length;
				for (int startPosition = 0; startPosition <= maxPosition; startPosition++) {
					if (checkIsPalindrome(startPosition, startPosition + length - 1)) {
						isPalindromeSubstring[length - 1][startPosition] = true;
						palindromeSubstrings[length - 1][startPosition] = input.substring(startPosition, startPosition + length);
					}
				}
			}
		}

		private boolean checkIsPalindrome(int startPosition, int endPosition) {
			if (endPosition <= startPosition) {
				return true;
			}

			if (inputChars[startPosition] != inputChars[endPosition]) {
				return false;
			}

			return checkIsPalindrome(startPosition + 1, endPosition - 1);
		}

		private void partition(String[] currentPartition, int currentPartitionLength, int lastSplitIndex) {
			if (lastSplitIndex == inputLength) {
				String[] partition = new String[currentPartitionLength];
				System.arraycopy(currentPartition, 0, partition, 0, currentPartitionLength);
				palindromePartitions.add(partition);
				return;
			}

			int maxSplitLength = inputLength - lastSplitIndex;
			for (int splitLength = 1; splitLength <= maxSplitLength; splitLength++) {
				// check if the chopped of string is a palindrome
				if (!isPalindromeSubstring[splitLength - 1][lastSplitIndex]) {
					continue;
				}

				int splitIndex = lastSplitIndex + splitLength;
				currentPartition[currentPartitionLength] = palindromeSubstrings[splitLength - 1][lastSplitIndex];
				partition(currentPartition, currentPartitionLength + 1, splitIndex);
			}
		}

	}

	public static List<String[]> partitionPalindrome(String input) {
		PalindromePartitioningAlgorithm algorithm = new PalindromePartitioningAlgorithm(input);
		return algorithm.computeResult();
	}

}

package dds_challenges;

import java.util.ArrayList;
import java.util.HashSet;
import java.util.List;
import java.util.Set;
import org.junit.jupiter.api.Test;

public class TestPalindromePartitioning {

	public static class PalindromePartitioningAlgorithm {

		private final String input;
		private final char[] inputChars;
		private final int inputLength;
		private final List<String[]> palindromePartitions = new ArrayList<>();

		/**
		 * <p> Key is `0b_000AAAAA_000BBBBB` where A is the startPosition of the substring, and B is its length
		 */
		private final Set<Integer> palindromeSubstrings = new HashSet<>();

		public PalindromePartitioningAlgorithm(String input) {
			this.input = input;
			this.inputChars = input.toCharArray();
			inputLength = inputChars.length;
		}

		public List<String[]> computeResult() {
			precomputePalindromeSubstrings();
			partition(0, 0);
			return palindromePartitions;
		}

		private void precomputePalindromeSubstrings() {
			// this is O(n³), but checking for palindromes while partitioning would be O(2^n * n), so this is still preferable.
			for (int length = 1; length <= inputLength; length++) {
				int substringKey_Length = 0b11111 & length;
				int maxPosition = inputLength - length;
				for (int startPosition = 0; startPosition <= maxPosition; startPosition++) {
					int substringKey_startPosition = (0b11111 & startPosition) << 8;
					if (checkIsPalindrome(startPosition, startPosition + length - 1)) {
						palindromeSubstrings.add(substringKey_Length | substringKey_startPosition);
					}
				}
			}
		}

		private boolean checkIsPalindrome(int startPosition, int endPosition) {
			if (endPosition <= startPosition) {
				return true;
			}

			if (inputChars[startPosition] != inputChars[endPosition]) {
				return false;
			}

			return checkIsPalindrome(startPosition + 1, endPosition - 1);
		}

		private boolean lookupIsPalindrome(int startPosition, int length) {
			int substringKey = ((0b11111 & startPosition) << 8) | (0b11111 & length);
			return palindromeSubstrings.contains(substringKey);
		}

		private void partition(int splitsBitMap, int lastSplitIndex) {
			int maxSplitLength = inputLength - lastSplitIndex;
			for (int splitLength = 1; splitLength < maxSplitLength; splitLength++) {
				// check if the chopped of string is a palindrome
				if (!lookupIsPalindrome(lastSplitIndex, splitLength)) {
					continue;
				}

				int splitIndex = lastSplitIndex + splitLength;
				partition(splitsBitMap | (0b1 << splitIndex), splitIndex);
			}

			if (lookupIsPalindrome(lastSplitIndex, maxSplitLength)) {
				storePalindromePartition(splitsBitMap);
			}
		}

		private void storePalindromePartition(int splitsBitMap) {
			int numSplits = Integer.bitCount(splitsBitMap);
			String[] partition = new String[numSplits + 1];
			int previousSplitIndex = 0;
			int partitionIndex = 0;
			for (int splitIndex = 1; splitIndex < inputLength; splitIndex++) {
				if ((splitsBitMap & (0b1 << splitIndex)) != 0) {
					partition[partitionIndex++] = input.substring(previousSplitIndex, splitIndex);
					previousSplitIndex = splitIndex;
				}
			}
			partition[partitionIndex] = input.substring(previousSplitIndex);
			palindromePartitions.add(partition);
		}

	}

	public static List<String[]> partitionPalindrome(String input) {
		PalindromePartitioningAlgorithm algorithm = new PalindromePartitioningAlgorithm(input);
		return algorithm.computeResult();
	}

}

using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace Prime_Factorization
{
    class Program
    {
        static void Main(string[] args)
        {
            int Prime = 1;
            double doublePrime = 0;
            int TimesDividingPrimes = 0;
            bool CheckPrime = true;
            int PrimeDivide = 1;
            bool StopLoop1 = false;
            int PowerCount = 0;
            int WhileUserNumber = 0;
            bool StopAll = false;

            Console.WriteLine("Enter the number you would like to see factorized");
            string UserNumber = Console.ReadLine();
            WhileUserNumber = int.Parse(UserNumber);

            while (StopAll == false)
            {
                ++Prime;
                doublePrime = Math.Sqrt(Prime);
                TimesDividingPrimes = (int)doublePrime;
                for (int PrimeLoop2 = 1; PrimeLoop2 < TimesDividingPrimes; ++PrimeLoop2)
                {
                    ++PrimeDivide;
                    if (Prime % PrimeDivide == 0 && Prime != 2)
                    {
                        CheckPrime = false;
                    }
                    if (CheckPrime == false)
                    {
                        PrimeLoop2 = TimesDividingPrimes;
                    }
                }
                PrimeDivide = 1;

                if (CheckPrime == true)
                {
                    while (StopLoop1 == false)
                    {
                        if (WhileUserNumber % Prime == 0 && WhileUserNumber != 1)
                        {
                            ++PowerCount;
                            WhileUserNumber = (WhileUserNumber / Prime);
                        }
                        else
                        {
                            StopLoop1 = true;
                        }
                        if (WhileUserNumber == 1)
                        {
                            StopLoop1 = true;
                            StopAll = true;
                        }
                    }
                    if (PowerCount == 1)
                    {
                        Console.WriteLine(Prime);
                    }
                    else if (PowerCount > 1)
                    {
                        Console.WriteLine(Prime + "^" + PowerCount);
                    }
                    PowerCount = 0;
                }
                CheckPrime = true;
                StopLoop1 = false;





            }
            Console.ReadLine();

        }
    }
}

