#include "bits/stdc++.h"

using namespace std;

#define int long long

#define fastio                        \
    ios_base::sync_with_stdio(false); \
    cin.tie(NULL);                    \
    cout.tie(NULL)
#define pb push_back
#define pii pair<int, int>
#define vi vector<int>
#define vvi vector<vi>
#define rep(i, a, b) for (int (i) = (a); (i) < (b); ++(i))
const int mod = 1e9 + 7;

void bfs(int row, int col, vector<string> &s, vvi &vis, int n, int m) {

    queue<pii > q;
    q.push({row, col});

    vis[row][col] = 1;

    vvi dir = {
            {0,  1},
            {0,  -1},
            {-1, 0},
            {1,  0}
    };

    while (!q.empty()) {
        int r = q.front().first, c = q.front().second;
        q.pop();

        for (auto d: dir) {
            int nr = r + d[0], nc = c + d[1];

            if (nr >= 0 && nc >= 0 && nr < n && nc < m) {

                if (s[nr][nc] == '.' && !vis[nr][nc]) {
                    // it is a floor and unvisited
//                    !vis[nr][nc]
//                  vis[nr][nc] == 0

                    vis[nr][nc] = 1;
                    q.push({nr, nc});
                }

            }
        }

    }

}

void dfs(int row, int col, vector<string> &s, vvi &vis, int n, int m) {

    vis[row][col] = 1;

    vvi dir = {
            {0,  1},
            {0,  -1},
            {-1, 0},
            {1,  0}
    };

    for (auto d: dir) {
        int nr = row + d[0], nc = col + d[1];

        if (nr >= 0 && nc >= 0 && nr < n && nc < m) {

            if (s[nr][nc] == '.' && !vis[nr][nc]) {
                dfs(nr, nc, s, vis, n, m);
            }

        }
    }


}

void test_case() {
    int n, m;
    cin >> n >> m;

    vector<string> s(n);

    rep(i, 0, n) {
        cin >> s[i];
    }

    vvi vis(n, vi(m));

    int cnt = 0;
    for (int i = 0; i < n; i++) {
        for (int j = 0; j < m; j++) {

            if (s[i][j] == '.' && !vis[i][j]) {
                // it is a floor and unvisited
//                bfs(i, j, s, vis, n, m);
                dfs(i, j, s, vis, n, m);
                cnt++;
            }

        }
    }
    cout << cnt;

}

signed main() {
    fastio;
    int t = 1;
//    cin >> t;
    for (int i = 1; i <= t; i++) {
        test_case();
    }
}
